import React from "react";
import { createBrowserRouter } from "react-router-dom";
import App from "./App";
import HomePage from "./pages/home/HomePage";

const routing = createBrowserRouter([{
path: "/",
element: <App />,
children: [
{
path: "homepage",
element: <HomePage />,
},
{
}
]
}])
export default routing;
